import React from 'react';
function App(){
    const name = 'react';
    const style = {
        backgroundColor: 'black',
        color: 'aqua',
        fontSize: 24,
        padding: '1rem'
    }
}


function Hello(){
    return (
        <>
            <div>안녕하세요</div>
            <div style={App.style}>{App.name}</div>
        </>
    )

}

export default Hello;
